import axios from 'axios';
import React, { useEffect, useState } from 'react';
import './Customer.css';
import './Signin.css';

function Customer() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('');
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [showComponents, setShowComponents] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();

    if (!username || !password || !role) {
      alert('Please fill in all fields');
      return;
    }

    try {
      const response = await axios.get(`http://localhost:8080/login?email=${encodeURIComponent(username)}&password=${encodeURIComponent(password)}`);

      if (response.status === 200) {
        setIsLoggedIn(true);

        setTimeout(() => {
          setShowComponents(true);

          let redirectUrl = '#';
          if (role === 'Customer') {
            redirectUrl = '/emply';
          } else if (role === 'Hospital TPA') {
            redirectUrl = '/hospital-tpa';
          } else if (role === 'Admin') {
            redirectUrl = '/admin';
          }
          window.location.href = redirectUrl;
        }, 1000); // Allow some time for the transition to complete
      }
    } catch (error) {
      if (error.response && error.response.status === 401) {
        alert('Invalid username or password');
      } else {
        alert('An error occurred. Please try again.');
      }
    }
  };

  useEffect(() => {
    if (isLoggedIn) {
      setTimeout(() => {
        setShowComponents(true);
      }, 1000);
    }
  }, [isLoggedIn]);

  return (
    <div className='bg'>
      <div className={`wrapper ${isLoggedIn ? 'expand' : ''}`}>
        <video src='/videos/video-7.mp4' autoPlay loop muted />
        <div className='dual'>
          <div className='bg-img'></div>
          <div className={`wrapper1 ${isLoggedIn ? 'expanded' : ''}`}>
            <form onSubmit={handleLogin}>
              <h1>Welcome Back!</h1>
              <div className="input-box">
                <input
                  type="text"
                  placeholder="Email"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  required
                />
              </div>
              <div className="input-box">
                <input
                  type="password"
                  placeholder="Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
              <div className="input-box">
                <select 
                  value={role}
                  onChange={(e) => setRole(e.target.value)}
                  required
                >
                  <option value='' disabled>Select Role</option>
                  <option value="Customer">Customer</option>
                  <option value="Hospital TPA">Hospital TPA</option>
                  <option value="Admin">Admin</option>
                </select>
              </div>
              <div className="remember-forgot">
                <a href="/forgot">Forgot password?</a>
              </div>
              <button type='submit'>Login</button>
              <div className="register-link">
                <p>Don't have an account?<a href="/sign-up">Register</a></p>
              </div>
            </form>
          </div>
        </div>
      </div>
      {showComponents && (
        <div className="admin-dashboard">
          <div className="sidebar">Sidebar content</div>
          <div className="main-content">
            <div className="header">Header content</div>
            <div className="functions">
              <div className="function-card">Function 1</div>
              <div className="function-card">Function 2</div>
              <div className="function-card">Function 3</div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Customer;
